def meanSquaredDifference(l1, l2):
    positions = dict()

    for i, e in enumerate(l1):
        positions[e] = [i] 

    for i, e in enumerate(l2):
        positions[e].append(i)

    total_difference = 0
    elements = len(l1)
    for _, val in positions.items():
        total_difference += (val[0] - val[1]) ** 2

    return float(total_difference) / float(elements)

